issue.body:
For the following MWE, `\test` is replicated to the CCMemo, but `\mytest` is not. 
```latex
\documentclass{article}
\usepackage{memoize}
\mmzset{prefix=memos/,
  auto=\test{replicate,args=,},
  auto=\mytest{replicate,args=,},
}
\def\test{test}
\begin{document}
\def\mytest{prawf}
\begin{memoize}
  abc
  \test
  \mytest
\end{memoize}
\end{document}
```
Memos:
```latex
\mmzResource{B9226F96A1F46D6457F3893AE2FF8330-E778DCCCB8AAB0BBD3F6CFEEFD2421F8.pdf}%
\mmzMemo 
\quitvmode \test \mmzIncludeExtern {0}\hbox {59.25pt}{7.05pt}{1.94pt}{72.26999pt}{72.26999pt}{7
2.26999pt}{72.26999pt}%
\mmzEndMemo 
```
```latex
\mmzMemo 
\global \mmzContextExtra {}%
%
\mmzSource 
abc \test \mytest 
```
The following shows that `\mytest` is not advised at all:
```latex
\documentclass{article}
\usepackage{memoize}
\mmzset{prefix=memos/,
  trace,
  auto=\test{replicate,args=,},
  auto=\mytest{replicate,args=,},
}
\def\test{test}
\begin{document}
\def\mytest{prawf}
\verb|\test|:\par\test\par \meaning\test\par
\verb|\mytest|:\par\mytest\par \meaning\mytest\par
Memoized:\par
\begin{memoize}
  \texttt{\textbackslash test}: \meaning\test
\end{memoize}

\begin{memoize}
  \texttt{\textbackslash test}: \test
\end{memoize}

\begin{memoize}
  \texttt{\textbackslash mytest}: \meaning\mytest
\end{memoize}

\begin{memoize}
  \texttt{\textbackslash mytest}: \mytest
\end{memoize}
\end{document}
```

I'm not sure if this is expected or not, but I cannot immediately see any straightforward workaround. If I use a custom `outer handler` with `auto`, for example, it is never invoked. 

This affects `expl3` variables, in particular, which may be declared in the preamble, but set only later. That is, it is common to have something like
```latex
\ExplSyntaxOn
\tl_new:N \g_test_tl
\ExplSyntaxOff
\begin{document}
...
<some function which sets \g_test_tl>
...
<use of \g_test_tl during memoization>
\end{document}
```
but then attempting to use `auto csname={g_test_tl}{...},` in the preamble fails.

comment.body:
OK. I really should not have tried to translate this. I just knew you don't like `expl3`. 

The problem is that defined variables fail if they are empty. 
```latex
\documentclass{article}
\usepackage{memoize}
\ExplSyntaxOn
\tl_new:N \g_test_tl
\tl_new:N \g_prawf_tl
\newcommand\settest[1]{\tl_gset:Nn \g_test_tl {#1}}
\newcommand\printtest{\g_test_tl}
\newcommand\setprawf[1]{\tl_gset:Nn \g_prawf_tl {#1}}
\newcommand\printprawf{\g_prawf_tl}
\ExplSyntaxOff
\setprawf{fy mhrawf}
\mmzset{auto csname={g_test_tl}{replicate,args=}}
\mmzset{auto csname={g_prawf_tl}{replicate,args=}}
\begin{document}
\settest{my test}
\begin{memoize}
  \printtest
  \printprawf
\end{memoize}
\end{document}
```
Here both variables are defined, but only the one which non-empty when advised is replicated. 

However, I can't currently remember why I wanted to do this.

